/** @jsx jsx */
import { jsx, css } from '@emotion/core';
import React from 'react';

import Layout from '../components/Layout';
const styles = css`
  h2 {
    font-size: 20px;
    text-align: center;
  }
  text-align: center;
  p {
    margin-left: auto;
    margin-right: auto;
    width: 50%;
    background-color: rgb(255, 255, 255, 0.8);
  }
`;
const parallax1 = css `
  margin-top: 55px;
  background-image: url('trees.jpeg');
  min-height: 800px;
  width: 100%;
  opacity: 0.75;
  background-attachment: fixed;
  background-position: center;
  background-repeat: no-repeat;
  background-size: 100%;
`;

const parallax2 = css `
  margin-top: 55px;
  background-image: url('cars.jpeg');
  min-height: 800px;
  width: 100%;
  opacity: 0.75;
  background-attachment: fixed;
  background-position: center;
  background-repeat: no-repeat;
  background-size: 100%;
`;

const parallax3 = css `
  margin-top: 55px;
  background-image: url('fog.jpeg');
  min-height: 800px;
  width: 100%;
  opacity: 0.75;
  background-attachment: fixed;
  background-position: center;
  background-repeat: no-repeat;
  background-size: 100%;
`;

const caption = css`
  position: absolute;
  left: 0;
  top: 50%;
  width: 100%;
  text-align: center;
  color: #000;
`;

const border = css`
  background-color: #111;
  color: #fff;
  padding: 18px;
  font-size: 25px;
  letter-spacing: 10px;
`;

const words = css `
  color: #777;
  background-color: white;
  text-align: center;
  padding: 50px 80px;
  text-align: justify;
  .p {
    display: block;
    margin-block-start: 1em;
    margin-block-end: 1em;
    margin-inline-start: 0px;
    margin-inline-end: 0px;
  }
  .h3 {
    display: block;
    font-size: 1.17em;
    margin-block-start: 1em;
    margin-block-end: 1em;
    margin-inline-start: 0px;
    margin-inline-end: 0px;
    font-weight: bold;
    letter-spacing: 5px;
    text-transform: uppercase;
    font: 20px "Lato", sans-serif;
    color: #111;
    text-align: center;
  }
`;

function Home() {
  return (
    <Layout>
      <div css={parallax1}></div>
      <div css={caption}>
        <span css={border}>MEGAN LILES</span>
      </div>
      <div css={words}>
        <h3>WELCOME.</h3>
        <p>Feel free to look around and check out my resume and github projects!</p>
      </div>
      <div css={parallax2}></div>
      <div css={words}>
        <p>I am currently actively looking for full time positions in the
          Computer Science world as a Web Developer, Software Engineer, Mobile
          App Developer or anything in the UX industry! I will be graduating
          June 2020 from Oregon State University with a Bachelor's in Computer
          Science.</p>
      </div>
      <div css={parallax3}></div>
    </Layout>
  );
}

export default Home;
